import React from 'react';

function User(props) {
  if (!props.user) return null; // Prevent error if user is undefined

  // Your backend uses _id, not id
  const { _id, name, age, address } = props.user;

  return (
    <div>
      <h1>User display</h1>
      <br />
      <h1>id: {_id}</h1>
      <h1>Name: {name}</h1>
      <h1>Age: {age}</h1>
      <h1>Address: {address}</h1>
      <button>Update </button>
      <button>Delete </button>
    </div>
  );
}
